import React, { useEffect, useState } from 'react';
import Btradel1_c from './charts/Btradel1_c';
import * as d3 from 'd3';

function Btradel1() {
    const [data, setData] = useState();

    useEffect(() => {
        d3.csv('https://github.com/vijayEE1997/AI-Databases/blob/master/Book1.csv')
            .then(data=>{console.log(data)})
            .catch("huh");
    }, []);

    return (
        <React.Fragment>
            <Btradel1_c width={900} height={400} data={data} />
        </React.Fragment>
    )
}

export default Btradel1;
